import React from "react";
import { Typography, Button, Card, CardActions, CardContent, Divider, Grid, Container, CardMedia, Modal, Box } from '@material-ui/core'
import {useState} from "react"
import useStyles from "../styles";
//import DropDown from './subcomponents/DropDownExpertise'
import CssBaseline from '@mui/material/CssBaseline';

import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

import participants from "../data/Participants";

const Expertise = () => {

    //added
    const [pmExpertise, setPmExpertise] = React.useState('');
    const [analysisExpertise, setAnalysisExpertise] = React.useState('');
    const [selectedParticipants, setSelectedParticipants] = React.useState(participants);

    const handleSelectedParticipants = () => {
        const valuePar = participants
        setSelectedParticipants(valuePar)
        //participants.map(participant => {
            //if (pmExpertise == participant.pmExpertise && analysisExpertise == participant.analysisExpertise) {
                //selectedParticipants.push(participant)
            //}
        //});
    }

    const handleChangePMExpertise = (event) => {
        setPmExpertise(event.target.value);
        handleSelectedParticipants()
    };

    const handleChangeAnalysisExpertise = (event) => {
        //calculateParticipants()
        setAnalysisExpertise(event.target.value);
    };

    const style = {
        position: 'absolute',
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)',
        width: 400,
        bgcolor: 'background.paper',
        border: '2px solid #000',
        boxShadow: 24,
        p: 4,
      };
    const classes = useStyles()
    const [open, setOpen] = useState(false);
    return (
        <Container maxWidth="md">
        <CssBaseline />
        <Grid container spacing={2} direction="row">
        <Grid item xs={12}></Grid>
        <Grid item xs={12}></Grid>
        <Grid item xs={12}>
            <Typography variant="h2" align="center" color="textPrimary">
                ProMiSE expertise data
            </Typography>
        </Grid>
        <Grid item xs={3}></Grid>
        <Grid item xs={6}>
            <Typography variant="body1" color="textPrimary" align="center">
            The chosen participants have different levels of expertise. Here you find how experienced a certain participant in terms of process mining and analysis is.
            </Typography>
        </Grid>
        <Grid item xs={3}></Grid>
        <Grid item xs={12}>
            <Divider p={5}/>
        </Grid>
        <Grid item xs={12} align="center">


      <FormControl sx={{ m: 1, minWidth: 120 }}>
        <InputLabel id="demo-simple-select-helper-label">PM</InputLabel>
        <Select
          labelId="demo-simple-select-helper-label"
          id="demo-simple-select-helper"
          value={pmExpertise}
          label="PM expertise"
          onChange={handleChangePMExpertise}
        >
        <MenuItem value="">
                <em>None</em>
        </MenuItem>
        <MenuItem value={"Basic"}>Basic</MenuItem>
        <MenuItem value={"Average"}>Average</MenuItem>
        <MenuItem value={"Good"}>Good</MenuItem>
        <MenuItem value={"Advanced"}>Advanced</MenuItem>
        </Select>
        <FormHelperText>Select PM expertise</FormHelperText>
      </FormControl>

      <FormControl sx={{ m: 1, minWidth: 120 }}>
      <InputLabel id="demo-simple-select-helper-label">Analysis</InputLabel>
        <Select
          labelId="demo-simple-select-helper-label"
          id="demo-simple-select-helper"
          value={analysisExpertise}
          label="Analysis expertise"
          onChange={handleChangeAnalysisExpertise}
        >
          <MenuItem value="">
            <em>None</em>
          </MenuItem>
          <MenuItem value={1}>None</MenuItem>
          <MenuItem value={"Basic"}>Basic</MenuItem>
          <MenuItem value={"Average"}>Average</MenuItem>
          <MenuItem value={"Good"}>Good</MenuItem>
          <MenuItem value={"Advanced"}>Advanced</MenuItem>
        </Select>
        <FormHelperText>Select analysis expertise</FormHelperText>
      </FormControl>


        </Grid>
            <Grid container spacing={4}>
                {selectedParticipants.map((participant) => (   
                <Grid item key={participant.name} xs={12} sm={6} md={4}>
                        <Card className={classes.card}>
                            <CardMedia 
                                className = {classes.cardMedia}
                                image={require('../data/participant_profiles/'+String(participant.name)+'.jpg')} 
                            />
                            <CardContent className={classes.cardContent}>
                                <Typography variant="h5">
                                    {participant.name}
                                </Typography>
                                <Typography variant="body2" sx={{ fontWeight: 'bold' }}>
                                    Process Mining expertise: {participant.pmExpertise}
                                </Typography>
                                <Typography variant="body2">
                                    Analysis expertise: {participant.analysisExpertise}
                                </Typography>
                                <Typography variant="body2">

                                </Typography>
                            </CardContent>
                            <CardActions>
                                <Button size="small" color="primary" onClick={() => setOpen(true)}>Show participant profile</Button>
                                <Modal
                                    open={open}
                                    onClose={() => setOpen(false)}
                                    aria-labelledby="child-modal-title"
                                    aria-describedby="child-modal-description"
                                    >
                                <Box 
                                    className={classes.modal}
                                    component="img"
                                    alt="The house from the offer."
                                    src={require('../data/participant_profiles/'+String(participant.name)+'.jpg')} 
                                />
                                </Modal>
                            </CardActions>
                        </Card>
                    </Grid>
                    ))}
            </Grid>
            <Grid item xs={12}></Grid>
            <Grid item xs={12}></Grid>
            <Grid item xs={12}>
                <Divider p={5}/>
            </Grid>
            </Grid>
        </Container>
    );
}

export default Expertise;
